name: teads-curve-demo+grafana+mock
description: null
tags: null
initialize:
  plugins:
    mock-observations:
      path: builtin
      method: MockObservations
      config:
        timestamp-from: 2025-01-01T00:00
        timestamp-to: 2025-01-30T00:00
        duration: 3600
        components:
          - cloud/instance-type: A1
        generators:
          common:
            region: italynorth
            common-key: common-val
          randint:
            cpu/utilization:
              min: 1
              max: 99
            memory/utilization:
              min: 1
              max: 99
    grafana-exporter:
      path: https://github.com/perkss/grafana-export
      method: GrafanaExport
    interpolate:
      path: builtin
      method: Interpolation
      config:
        method: linear
        x:
          - 0
          - 10
          - 50
          - 100
        'y':
          - 0.12
          - 0.32
          - 0.75
          - 1.02
        input-parameter: cpu/utilization
        output-parameter: cpu-factor
    cpu-factor-to-wattage:
      path: builtin
      method: Multiply
      config:
        input-parameters:
          - cpu-factor
          - thermal-design-power
        output-parameter: cpu-wattage
    wattage-times-duration:
      path: builtin
      method: Multiply
      config:
        input-parameters:
          - cpu-wattage
          - duration
        output-parameter: cpu-wattage-times-duration
    wattage-to-energy-kwh:
      path: builtin
      method: Divide
      config:
        numerator: cpu-wattage-times-duration
        denominator: 3600000
        output: cpu-energy-raw
    calculate-vcpu-ratio:
      path: builtin
      method: Divide
      config:
        numerator: vcpus-total
        denominator: vcpus-allocated
        output: vcpu-ratio
    correct-cpu-energy-for-vcpu-ratio:
      path: builtin
      method: Divide
      config:
        numerator: cpu-energy-raw
        denominator: vcpu-ratio
        output: cpu-energy-kwh
    energy-to-carbon:
      path: builtin
      method: Multiply
      config:
        input-parameters:
          - grid-carbon-intensity
          - cpu-energy-kwh
        output-parameter: carbon
execution:
  command: >-
    /Users/leonardovicentini/.nvm/versions/node/v18.6.0/bin/node
    /Users/leonardovicentini/.nvm/versions/node/v18.6.0/bin/if-run --manifest
    manifests/teads-curve-demo.yaml --output outputs/out-teads-curve-demo.yaml
  environment:
    if-version: 1.0.0
    os: macOS
    os-version: 13.3.1
    node-version: 18.6.0
    date-time: 2025-01-15T23:01:35.020Z (UTC)
    dependencies:
      - >-
        grafana-export@v0.1.0
        (git+ssh://git@github.com/perkss/grafana-export.git#cceb534b9802688cfb5b4eda49d7f699ea847ddb)
      - jest@29.4.3
      - leaflet@1.9.3
      - rejson@0.1.0
  status: success
